      setIsRegistering(false);
    } catch (error) {
      console.error("Registration failed:", error.response.data);
    }
  };

  const validateLoginFields = () => {
    const errors = {};
    if (!userData.username) {
      errors.username = "El nombre de usuario no puede estar vacÃ­o";
    }
    if (!userData.password) {
      errors.password = "La contraseÃ±a no puede estar vacÃ­a";
    }
    return errors;
  };

  const loginUser = async () => {
    const errors = validateLoginFields();
    if (Object.keys(errors).length > 0) {
      setUserData({ ...userData, errors });
      return;
    }
    try {
      const response = await axios.post(
        "http://localhost:8080/api/auth/login",
        {
          username: userData.username.toLowerCase(),
          password: userData.password,
        }
      );
      /* eslint-disable */console.log(...oo_oo(`2839621318_469_6_469_32_4`,response.data));
      setUserData({ ...userData, connected: true, errors: {} });
    } catch (error) {
      console.error("Login failed:", error.response.data);
      setUserData({
        ...userData,
        errors: {
          ...errors,
          login: "Nombre de usuario o contraseÃ±a incorrectos",
        },
      });
    }
  };

  const handleLogout = () => {
    stompClient.disconnect(() => {
      axios
        .post("/api/users/disconnect", { username: userData.username })
        .then(() => {
          handleUserDisconnect(userData.username);
          window.location.href = "/login";
        })
        .catch((error) => {
          console.error(error);
        });
    });
  };

  const handleUserDisconnect = (username) => {
    setAllUsers((prevUsers) =>
      prevUsers.filter((user) => user.username !== username)
    );
  };
  return (
    <ChatRoomUI
      userData={userData}
      privateChats={privateChats}
      publicChats={publicChats}
      tab={tab}
      setTab={handleTabChange}
      handleMessage={handleMessage}
      sendValue={sendValue}
      sendPrivateValue={sendPrivateValue}
      handleUsername={handleUsername}
      registerUser={registerUser}
      loginUser={loginUser}
      unreadMessages={unreadMessages}
      isRegistering={isRegistering}
      setIsRegistering={setIsRegistering}
      allUsers={allUsers}
      searchQuery={searchQuery}
      setSearchQuery={setSearchQuery}
      searchUsers={searchUsers}
      logoutUser={handleLogout}
      act={handleUserDisconnect}
    />
  );
};

